The two stars of Alis Locanta's &quot;Slippery When Wet,&quot; Amarna Miller and Tracy Lindsay, make a striking and appealing couple. Miller's vivid scarlet hair contrasts pleasingly with Lindsay's blonde tresses, as do their complexions, the former creamily pale, the latter subtly sun-kissed. And they've got a genuine on-screen chemistry Ã¢â‚¬â€ in the opening sequence of the film they run hand-in-hand through an unanticipated rainstorm and their joy at sharing the experience is abundant and sincere. 

